import React from "react";

const Teachers = ({teachers}) => {
    console.log(teachers)
    return (
        <div>
            {teachers.map(t => 
                <div>
                    <h2>{t.name_teacher} {t.last_name_teacher}</h2>
                    <p>{t.rank_teacher}</p>
                </div>
                )}
        </div>
    )
}

export default Teachers
